import React, {useEffect} from 'react';
import { Col, Row,Form,Switch } from 'antd';
import { Typography } from 'antd';
import { AudioOutlined } from '@ant-design/icons';
import { Input, Space } from 'antd';
const { Search } = Input;


const Home = () => {
    const { Title } = Typography;
    const suffix = (
        <AudioOutlined
            style={{
                fontSize: 16,
                color: '#1890ff',
            }}
        />
    );
    const onSearch = (value) => {console.log(value);};

    return (
        <div>
            <Title level={1}>STOCK MANAGEMENT</Title>
            <div>
                <Row>
                    <Col span ={8}></Col>
                    <Col span ={8}>
                        <Space>
                            <Search
                                placeholder="input search text"
                                enterButton="Query"
                                size="large"
                                onSearch={onSearch}
                            />
                        </Space>
                    </Col>
                    <Col span ={8}></Col>
                </Row>

            </div>
        </div>
    );
};

export default Home;
